        <li key={ingredient}>{ingredient}</li>
    ))
    function handleSubmit() {
        console.log("Form submitted!")
    }
    return(
        <main>
            <form className="ingredients-form">
                <input 
                    type="text"
                    placeholder="e.g. oregano"
                    aria-label="Add ingredient"/>
                <button>
                    + Add Ingredient
                </button>
                <ul>
                {ingredientsListItems}
                </ul>
            </form>
        </main>
    )
}
